//OPERADOR ARITMETICO:  SUMA
console.log(6 + 6);

//OPERARDOR ARITMETICO: RESTA
console.log(87 - 10);

//OPERADOR ARITMETICO: MULTIPLICACION 
console.log(28 * 2);

//OPERADOR ARITMETICO:  DIVISION
console.log(34 / 2);

//OPERADOR ARITMETICO: MODULO  
console.log(34 % 2);

//OPERADOR ARITMETICO: DE INCREMENTO 
let numero = 6;
console.log(++numero);

//OPERADOR ARITMETICO: DECREMENTO
let otroNumero = 10;
console.log(--otroNumero);

//OPERADOR DE  COMPARACION: SIMPLE 
console.log(5 == "5");

//OPERADOR DE  COMPARCION: ESTRICTA
console.log(5 === "5");

//OPERADOR DE COMPARACION:  DESIGUALDAD SIMPLE, SOLO PREGUNTA POR EL VALOR 
console.log(5 != "5");

//OPERADOR DE COMPARACION: DESIGULADAD ESTRICTA,PREGUNTA POR VALOR Y TIPO DE DATO  
console.log(5 !== "5");

// OPERADOR DE COMPARACION: MAYOR QUE 
console.log(6 > 6);

// OPERADOR DE COMPARACION: MAYOR O IGUAL QUE  
console.log(6 >= 6);

//OPERADOR DE COMPARACION: MENOR QUE 
console.log(7 < 7);

//OPERADOR DE COMPARACION: MENOR O IGUAL 
console.log(7 <= 7);

// OPERADOR LOGICOS: AND && siempre las dos condiciones tiene que ser verdadera 
console.log(false && true);

// OPERADOR LOGICO: OR || ejemplos: console.log(8>=15 || 8!=3) pregunta si ocho es igual a 3?
//siempre que se cumpala una 
console.log(false || false);

